package main

func F(n int) []int {
	result := make([]int, n)
	for i := 1; i <= n; i++ {
		if i%2 == 0 {
			result[i-1] = factorial(i)
		} else {
			result[i-1] = sumUpTo(i)
		}
	}
	return result
}

func factorial(num int) int {
	if num == 0 {
		return 1
	}
	fact := 1
	for i := 1; i <= num; i++ {
		fact *= i
	}
	return fact
}

func sumUpTo(num int) int {
	return num * (num + 1) / 2
}
